ings:"Allows an app to modify the sync settings for an account.  For example, this can be used to enable sync of the People app with an account.",permlab_readSyncStats:"read sync statistics",permdesc_readSyncStats:"Allows an app to read the sync stats for an account, including the history of sync events and how much data is synced.",permlab_subscribedFeedsRead:"read subscribed feeds",permdesc_subscribedFeedsRead:"Allows the app to get details about the currently synced feeds.",permlab_subscribedFeedsWrite:"write subscribed feeds",permdesc_subscribedFeedsWrite:"Allows the app to modify\n      your currently synced feeds. Malicious apps may change your synced feeds.",permlab_readDictionary:"read terms you added to the dictionary",permdesc_readDictionary:"Allows the app to read all words,\n       names and phrases that the user may have stored in the user dictionary.",permlab_writeDictionary:"add words to user-defined dictionary",permdesc_writeDictionary:"Allows the app to write new words into the\n      user dictionary.",permlab_sdcardRead:"test access to protected storage",permdesc_sdcardRead:"Allows the app to test a permission for the SD card that will be available on future devices.",permlab_sdcardWrite:"modify or delete the contents of your SD card",permdesc_sdcardWrite:"Allows the app to write to the SD card.",permlab_mediaStorageWrite:"modify/delete internal media storage contents",permdesc_mediaStorageWrite:"Allows the app to modify the contents of the internal media storage.",permlab_sdcardAccessAll:"access external storage of all users",permdesc_sdcardAccessAll:"Allows the app to access external storage for all users.",permlab_cache_filesystem:"access the cache filesystem",permdesc_cache_filesystem:"Allows the app to read and write the cache filesystem.",permlab_use_sip:"make/receive Internet calls",permdesc_use_sip:"Allows the app to use the SIP service to make/receive Internet calls.",permlab_readNetworkUsageHistory:"read historical network usage",permdesc